import { useCallback } from 'react';
import styles from './Main.module.css';


const Main = () => {

  	const onPhotoTextClick = useCallback(() => {
    		// Add your code here
  	}, []);

  	return (
    		<div className={styles.main}>
      			<div className={styles.crimewatch}>crimewatch</div>
      			<div className={styles.photo} onClick={onPhotoTextClick}>photo</div>
      			<div className={styles.scraperWebsite} onClick={onPhotoTextClick}>
        				<p className={styles.scraper}>scraper/</p>
        				<p className={styles.scraper}>website</p>
      			</div>
      			<div className={styles.home}>home</div>
      			<div className={styles.audio} onClick={onPhotoTextClick}>audio</div>
      			<div className={styles.settings}>settings</div>
      			<div className={styles.welcomeBackVigilante101Container}>
        				<p className={styles.scraper}>{`welcome back, vigilante101! `}</p>
        				<p className={styles.scraper}>what shall we check today?</p>
          					</div>
          		</div>);
};

export default Main;
